import React from "react";
import { Link } from "react-router-dom";
import "./NavBar.css";

function NavBar (){
    <div id="NavBar">
        <ul>
            <li>Hello</li>
        </ul>
        <Link to="/">Home</Link>
        <Link to="about">About</Link>
        <Link to="get-involved">Get Involved</Link>
        <Link to="merchandise">Merchandise</Link>
    </div>
}

export default NavBar;
